ADOBE PREMIERE ELEMENTS 9 TRAINING DVD FOR WINDOWS &amp; MAC (Exercise files included)

Lynda.com Premiere Elements 9 - Essential Training.

In Premiere Elements 9 Essential Training, author Jeff Sengstack breaks down the editing workflow into bite sized pieces, covering topics from setting up a project to exporting the final video to any format. The course also covers the basics of editing and advanced features like picture-in-picture overlays and audio and visual effects.

  * Overview of Premiere Elements
  * Starting a Project and Getting Media
  * Adding, Arranging, and Deleting Clips
  * Editing Clips
  * Applying and Adjusting Video Transitions
  * Applying and Editing Video Effects
  * Animating Effects and Clips
  * Creating, Adding, Editing, and Mixing Audio
  * Working with Titling Tools
  * Superimposing and Layering Clips
  * Automation
  * DVD Authoring
  * Saving and Sharing Movies

